import React from 'react'
import { AppBar, Toolbar, makeStyles } from "@material-ui/core";

const useStyles = makeStyles(() => ({
    header: {
      backgroundColor: "#400CCC",
    },
  }));

export default function Header() {
    const Nav = () => {
        return <Toolbar>Navigator</Toolbar>
    };

    return (
        <header>
          <AppBar>{Nav()}</AppBar>
        </header>
      );
}
